    data: |
      SELECT DISTINCT - cor1.col1 AS col0 FROM tab0 (FORMAT parquet), tab2 (FORMAT parquet) AS cor0, tab1 (FORMAT parquet) AS cor1;
  - name: tab0
  - name: tab1
  - name: tab2

outputs:
  - name: q10573.out
    data: |
      -10
      -13
      -26
